//-----------------------------------------------------------------------------
// Compute average over networks. Default is to use all networks
//-----------------------------------------------------------------------------
double hzz4e(double ele1_pt,
             double ele1_eta,
             double ele1_phi,
             double ele2_pt,
             double ele2_eta,
             double ele2_phi,
             double ele3_pt,
             double ele3_eta,
             double ele3_phi,
             double ele4_pt,
             double ele4_eta,
             double ele4_phi,
             double worst_iso_X_ele,
             double second_worst_iso_X_ele,
             double worst_vertex,
             double second_worst_vertex,
             double mZ,
             double mZstar,
             double mbestH,
             int first=0, int last=nshzz4e::nnetworks-1)
{
  if ( first < 0 ) first = 0;
  if ( last  < 0 ) last  = nshzz4e::nnetworks-1;
  if ( last  > nshzz4e::nnetworks-1 ) last = nshzz4e::nnetworks-1;
  if ( first > last )
    {
      std::cerr << "** hzz4e ** first-index > last-index"
                << std::endl; exit(3);
    }

  // Compute average over networks
  std::vector<double> in(nshzz4e::ninputs);
  in[0] = (ele1_pt - nshzz4e::mean[0]) / nshzz4e::sigma[0];
  in[1] = (ele1_eta - nshzz4e::mean[1]) / nshzz4e::sigma[1];
  in[2] = (ele1_phi - nshzz4e::mean[2]) / nshzz4e::sigma[2];
  in[3] = (ele2_pt - nshzz4e::mean[3]) / nshzz4e::sigma[3];
  in[4] = (ele2_eta - nshzz4e::mean[4]) / nshzz4e::sigma[4];
  in[5] = (ele2_phi - nshzz4e::mean[5]) / nshzz4e::sigma[5];
  in[6] = (ele3_pt - nshzz4e::mean[6]) / nshzz4e::sigma[6];
  in[7] = (ele3_eta - nshzz4e::mean[7]) / nshzz4e::sigma[7];
  in[8] = (ele3_phi - nshzz4e::mean[8]) / nshzz4e::sigma[8];
  in[9] = (ele4_pt - nshzz4e::mean[9]) / nshzz4e::sigma[9];
  in[10] = (ele4_eta - nshzz4e::mean[10]) / nshzz4e::sigma[10];
  in[11] = (ele4_phi - nshzz4e::mean[11]) / nshzz4e::sigma[11];
  in[12] = (worst_iso_X_ele - nshzz4e::mean[12]) / nshzz4e::sigma[12];
  in[13] = (second_worst_iso_X_ele - nshzz4e::mean[13]) / nshzz4e::sigma[13];
  in[14] = (worst_vertex - nshzz4e::mean[14]) / nshzz4e::sigma[14];
  in[15] = (second_worst_vertex - nshzz4e::mean[15]) / nshzz4e::sigma[15];
  in[16] = (mZ - nshzz4e::mean[16]) / nshzz4e::sigma[16];
  in[17] = (mZstar - nshzz4e::mean[17]) / nshzz4e::sigma[17];
  in[18] = (mbestH - nshzz4e::mean[18]) / nshzz4e::sigma[18];

  int   n = last - first + 1;
  double x = 0.0;
  for(int i=first; i <= last; i++) x += nshzz4e::netfun(in, nshzz4e::weight[i]);
  return x / n;
}

double hzz4e(std::vector<double>& in,
             int first=0,
             int last=nshzz4e::nnetworks-1)
{
  return hzz4e(in[0],
               in[1],
               in[2],
               in[3],
               in[4],
               in[5],
               in[6],
               in[7],
               in[8],
               in[9],
               in[10],
               in[11],
               in[12],
               in[13],
               in[14],
               in[15],
               in[16],
               in[17],
               in[18], first, last);
}

